import React from "react";
import Bot from "./Bot";

const BotCollection = ({ bots, onEnlist }) => {
  return (
    <div className="bot-collection">
      <h2>All Bots</h2>
      <div className="bots-container">
        {bots.map((bot) => (
          <Bot key={bot.id} bot={bot} onEnlist={onEnlist} />
        ))}
      </div>
    </div>
  );
};

export default BotCollection;
